import React, { Component } from 'react'
import ChartFlow from './ChartFlow';

export default class Overview extends Component {
    constructor(props) {
        super(props)
    }
  render() {
    return (
        <div className="card-box">
        <h4 className="header-title mb-4">Account Overview</h4>

        <div className="row">

            <ChartFlow title="Daily Sales" value="35,715"/>

            <ChartFlow title="Sales Analytics" value="97,511"/>

            <ChartFlow title="Statistics" value="965"/>

            <ChartFlow title="Total Revenu" value="965"/>

        </div>
    </div>
    )
  }
}
